import React from "react";
import styles from "./LoadingIcon.module.css";
const LoadingIcon = () => {
  return (
    <div className={styles.icon}>
      <img src="images/tardis-loading.gif" alt="loading..." />
    </div>
  );
};

export default LoadingIcon;
